          "required": false,
          "values": [
            "-\tZone A corresponds to the SKLH territory identified as \u201cAwiijii\u201d by plaintiffs in Delgamuukw. Geographically, Zone A encompasses the lower Bowser watershed up to a point about 2 miles above the head of Bowser Lake, and the Bell Irving River from around Owl Creek down to Irving Creek. It includes the western slope of the Oweegee and Strata Ranges and Wildfire Ridge, and the Longview Range. Other features include Gilbert Lake and Todedada, Scott and Wildfire Creeks.",
            "Before using the Zone D maps contact Jennifer Thiagarasan (MIRR) or Susan O'Sullivan (WLRS).",
            "Ensure consultation is conducted with the individual First Nations as St\u00f3:l\u014d Nation does not speak on behalf of its members regarding the crown duty to consult.",
            "Ensure consultation is conducted with the individual First Nations as St\u00f3:l\u014d Tribal Council does not speak on behalf of its members regarding the crown duty to consult.",
            "Mining consultation only",
            "Please refer to the Gitxsan Contact List (https://bcgov.sharepoint.com/sites/FOR-SIR/) for contact details. This site requires access. See PIP consultation advice for more information.",
            "Represents areas that the historical and ethnographic information indicates belonged to other Gitxsan wilp (some of the Tsetsaut origin like SKLH) and that are still recognized as such today. Most of the territory north of Meziadin Lake and the middle Nass was impacted by Tahltan invasions and occupation throughout the 19th century. Through a series of conflicts and reparation settlements, the Gitxsan (which now included many wilp of Tsetsaut origin) regained possession of the upper Nas region. This culminated in SKLH\u2019s acquisition of Awiijii in the 1890s. ",
            "Review BRFN BC Partner Agency Referral Process in Documents Section",
            "S'olh Temexw Stewardship Alliance - British Columbia Strategic Engagement Agreement: Use this contact and boundary for ALL referrals, whether in-scope or out-of-scope from the agreement. ",
            "This area was not included in the original Awiijii territory (Zone A); however, new information provided to BC indicated that the boundary submitted in Delgamuukw was based on Daniel Skawil\u2019s (Skii km Lax Ha) 20th century trapline and was not a representation of the whole house territory. This area encompasses the Snowslide Range, including Treaty Creek.",
            "This area was not included in the original Awiijii territory (Zone A); however, new information provided to BC indicated that the boundary submitted in Delgamuukw was based on Daniel Skawil\u2019s (Skii km Lax Ha) 20th century trapline and was not a representation of the whole house territory. This area encompasses the headwaters of the Bowser River and tributary drainages, Summit Lake, Knipple Lake, and the Frank Mackie Glacier.",
            "Zone 1: Nuchatlaht Declared Title Land.",
            "Zone 2: Nuchatlaht Claim Area boundaries outside of the Nuchatlaht Declared Title Land in respect of Nuchatlaht\u2019s asserted traditional territory",
            "alternate: referrals@pib.ca",
            "https://www.squamishconnect.com/    Direct all inquiries and referrals the Squamish Connect portal."
          ],
          "is_non_unique": true
