            "52 1500 Triangle Transects; Triangles established in pairs to ensure efficiencies in heli access with POCs 200 m apart.",
            "86 sample polygons selected; photo-interpreted for homogeneous areas and line transects plotted to traverse polygon and areas; 6 polygons of wetlands and anthropogenic content were not field-checked.",
            ">65% ON INDEPENDANT AA. Many stats calculated for this AA, most of which are less than 65%, but key statistic for use in TSR, the area-weighted overlap score, is 70% based on primary calls; 78.1 with alternates; considerable compound and complex polygons",
            "Acceptable overlap' score in this AA is the 'percent overlap' score - it is not equivalent to what is now call 'percent acceptable overlap'.  92 polygons, traverse design for each",
            "Air Photo - Proportional - 70.43% overall accuracy",
            "As this is only a Level 2 AA, even if it had achieved a pass score, it likely would not have been acceptable for TSR.  Considered Level 2 AA (QA); Combination of randomly chosen polygons for air photo interpretation and ground samples chosen from cluster",
            "Completed August 2015 by Tom Braumandl (Senior Ecologist; Ecora). SIBEC data have been collected for use with this PEM. Primary overlap score = 59.4%; alternate overlap score = 65.1%; primary dominant score = 47.8%; alternate dominant score = 52.2%.",
            "Contact Allen Banner, BC Ministry of Forests, Vancover Region. An earlier accuracy assessment that failed was completed in 2003. 73 1500 Triangle Transects; Triangles established in pairs to ensure efficiencies in heli access with POCs 200 m apart.",
