            "Salt water mud flats and inter tidal areas at the mouth of rivers and creeks where the vegetation is influenced by frequent flooding (at least yearly).",
            "Timber harvesting within the past 20 years, or older if tree cover is less than 40% and under 6 metres in height.",
            "Unimproved pasture and grasslands based on cover rather than use. Cover includes drought tolerant grasses, sedges, scattered shrubs to 6 metres in height and less than 35% forest cover. Sparse forest stands are included with their under storey of drought tolerant shrubs and herbs.",
