// State
let currentFilter = 'all';
let selectedDataset = null;
let selectedValues = []; // For multi-select copy
let copyFormat = localStorage.getItem('db-explorer-copy-format') || 'comma'; // comma, newline, sql-text, sql-number

// Theme Management
function initTheme() {
    const savedTheme = localStorage.getItem('db-explorer-theme');
    const prefersDark = window.matchMedia('(prefers-color-scheme: dark)').matches;
    const theme = savedTheme || (prefersDark ? 'dark' : 'dark'); // Default to dark
    document.documentElement.setAttribute('data-theme', theme);
}

function toggleTheme() {
    const currentTheme = document.documentElement.getAttribute('data-theme');
    const newTheme = currentTheme === 'dark' ? 'light' : 'dark';
    document.documentElement.setAttribute('data-theme', newTheme);
    localStorage.setItem('db-explorer-theme', newTheme);
}

// Initialize theme immediately to prevent flash
initTheme();

// DOM Elements
const searchInput = document.getElementById('searchInput');
const fieldSearch = document.getElementById('fieldSearch');
const tableList = document.getElementById('tableList');
const fcList = document.getElementById('fcList');
const tableCount = document.getElementById('tableCount');
const fcCount = document.getElementById('fcCount');
const stats = document.getElementById('stats');
const emptyState = document.getElementById('emptyState');
const datasetDetails = document.getElementById('datasetDetails');
const datasetType = document.getElementById('datasetType');
const datasetName = document.getElementById('datasetName');
const rowCount = document.getElementById('rowCount');
const fieldCount = document.getElementById('fieldCount');
const geometryType = document.getElementById('geometryType');
const fieldsContainer = document.getElementById('fieldsContainer');
const filterBtns = document.querySelectorAll('.filter-btn');

// Initialize
document.addEventListener('DOMContentLoaded', init);

function init() {
    renderStats();
    renderSidebar();
    setupEventListeners();
}

function renderStats() {
    const totalTables = sdeData.tables.length;
    const totalFCs = sdeData.feature_classes.length;
    const totalFields = [...sdeData.tables, ...sdeData.feature_classes]
        .reduce((sum, d) => sum + d.fields.length, 0);
    
    stats.innerHTML = `
        <span class="stat-item">
            <span class="stat-value">${totalTables}</span> Tables
        </span>
        <span class="stat-item">
            <span class="stat-value">${totalFCs}</span> Feature Classes
        </span>
        <span class="stat-item">
            <span class="stat-value">${totalFields}</span> Fields
        </span>
    `;
}

function renderSidebar(filter = '') {
    const filterLower = filter.toLowerCase();
    
    // Filter tables
    const filteredTables = sdeData.tables.filter(t => {
        const matchesSearch = t.short_name.toLowerCase().includes(filterLower) ||
            t.fields.some(f => f.name.toLowerCase().includes(filterLower));
        const matchesFilter = currentFilter === 'all' || currentFilter === 'tables';
        return matchesSearch && matchesFilter;
    });
    
    // Filter feature classes
    const filteredFCs = sdeData.feature_classes.filter(fc => {
        const matchesSearch = fc.short_name.toLowerCase().includes(filterLower) ||
            fc.fields.some(f => f.name.toLowerCase().includes(filterLower));
        const matchesFilter = currentFilter === 'all' || currentFilter === 'feature_classes';
        return matchesSearch && matchesFilter;
    });
    
    // Update counts
    tableCount.textContent = filteredTables.length;
    fcCount.textContent = filteredFCs.length;
    
    // Render tables
    tableList.innerHTML = filteredTables.map(t => `
        <li class="dataset-item table" data-name="${t.name}" data-type="table" role="button" tabindex="0" aria-label="${t.short_name} table with ${formatNumber(t.row_count)} rows">
            <span class="icon">
                <svg width="12" height="12" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
                    <rect x="3" y="3" width="18" height="18" rx="2"/>
                    <path d="M3 9h18M9 21V9"/>
                </svg>
            </span>
            <span class="name" title="${t.name}">${t.short_name}</span>
            <span class="row-count">${formatNumber(t.row_count)}</span>
        </li>
    `).join('');
    
    // Render feature classes
    fcList.innerHTML = filteredFCs.map(fc => `
        <li class="dataset-item feature-class" data-name="${fc.name}" data-type="feature_class" role="button" tabindex="0" aria-label="${fc.short_name} feature class with ${formatNumber(fc.row_count)} rows">
            <span class="icon">
                <svg width="12" height="12" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
                    <polygon points="12 2 2 7 12 12 22 7 12 2"/>
                    <polyline points="2 17 12 22 22 17"/>
                </svg>
            </span>
            <span class="name" title="${fc.name}">${fc.short_name}</span>
            <span class="row-count">${formatNumber(fc.row_count)}</span>
        </li>
    `).join('');
    
    // Add click handlers
    document.querySelectorAll('.dataset-item').forEach(item => {
        item.addEventListener('click', () => selectDataset(item.dataset.name, item.dataset.type));
    });
    
    // Re-highlight selected if still visible
    if (selectedDataset) {
        highlightSelected(selectedDataset);
    }
}

function selectDataset(name, type) {
    selectedDataset = name;
    highlightSelected(name);
    
    // Find dataset
    const dataset = type === 'table' 
        ? sdeData.tables.find(t => t.name === name)
        : sdeData.feature_classes.find(fc => fc.name === name);
    
    if (!dataset) return;
    
    // Update detail panel
    emptyState.classList.add('hidden');
    datasetDetails.classList.remove('hidden');
    
    // Update header
    datasetType.textContent = type === 'table' ? 'TABLE' : 'FEATURE CLASS';
    datasetType.className = 'dataset-type-badge ' + (type === 'table' ? 'table' : 'feature-class');
    datasetName.textContent = dataset.short_name;
    rowCount.innerHTML = `
        <svg width="14" height="14" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
            <path d="M17 21v-2a4 4 0 0 0-4-4H5a4 4 0 0 0-4 4v2"/>
            <circle cx="9" cy="7" r="4"/>
        </svg>
        ${formatNumber(dataset.row_count)} rows
    `;
    fieldCount.innerHTML = `
        <svg width="14" height="14" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
            <line x1="8" y1="6" x2="21" y2="6"/>
            <line x1="8" y1="12" x2="21" y2="12"/>
            <line x1="8" y1="18" x2="21" y2="18"/>
        </svg>
        ${dataset.fields.length} fields
    `;
    
    // Geometry type for feature classes
    if (type === 'feature_class' && dataset.geometry_type) {
        geometryType.classList.remove('hidden');
        geometryType.innerHTML = `
            <svg width="14" height="14" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
                <polygon points="12 2 2 7 12 12 22 7 12 2"/>
            </svg>
            ${dataset.geometry_type}
        `;
    } else {
        geometryType.classList.add('hidden');
    }
    
    // Clear field search
    fieldSearch.value = '';
    
    // Render fields
    renderFields(dataset.fields);
}

function renderFields(fields, filter = '') {
    const filterLower = filter.toLowerCase();
    const filteredFields = fields.filter(f => 
        f.name.toLowerCase().includes(filterLower) ||
        f.alias.toLowerCase().includes(filterLower) ||
        f.type.toLowerCase().includes(filterLower)
    );
    
    fieldsContainer.innerHTML = filteredFields.map((field, index) => {
        const hasValues = field.values && field.values.length > 0;
        const lengthStr = field.type_raw === 'String' ? ` (${field.length})` : '';
        
        return `
            <div class="field-card ${hasValues ? 'has-values' : ''}" style="animation-delay: ${index * 0.02}s">
                <div class="field-header" ${hasValues ? 'onclick="toggleValues(this)"' : ''}>
                    <div class="field-info">
                        <span class="field-name">${field.name}</span>
                        ${field.alias !== field.name ? `<span class="field-alias">(${field.alias})</span>` : ''}
                    </div>
                    <div class="field-meta">
                        <span class="field-type">${field.type}${lengthStr}</span>
                        ${hasValues ? `
                            <span class="values-toggle">
                                ${field.values.length} values
                                <svg width="12" height="12" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
                                    <polyline points="6 9 12 15 18 9"/>
                                </svg>
                            </span>
                        ` : ''}
                    </div>
                </div>
                ${hasValues ? `
                    <div class="field-values">
                        <div class="values-list">
                            ${field.values.map(v => `<span class="value-chip" data-value="${escapeHtml(String(v))}">${escapeHtml(String(v))}</span>`).join('')}
                        </div>
                    </div>
                ` : ''}
            </div>
        `;
    }).join('');
    
    // Add click handlers for value chips
    setupValueChipHandlers();
}

function toggleValues(header) {
    const card = header.closest('.field-card');
    const valuesDiv = card.querySelector('.field-values');
    const toggle = header.querySelector('.values-toggle');
    
    valuesDiv.classList.toggle('visible');
    toggle.classList.toggle('expanded');
}

function highlightSelected(name) {
    document.querySelectorAll('.dataset-item').forEach(item => {
        item.classList.toggle('active', item.dataset.name === name);
    });
}

function setupEventListeners() {
    // Main search
    searchInput.addEventListener('input', (e) => {
        renderSidebar(e.target.value);
    });
    
    // Field search
    fieldSearch.addEventListener('input', (e) => {
        if (!selectedDataset) return;
        
        const dataset = sdeData.tables.find(t => t.name === selectedDataset) ||
            sdeData.feature_classes.find(fc => fc.name === selectedDataset);
        
        if (dataset) {
            renderFields(dataset.fields, e.target.value);
        }
    });
    
    // Filter buttons
    filterBtns.forEach(btn => {
        btn.addEventListener('click', () => {
            filterBtns.forEach(b => b.classList.remove('active'));
            btn.classList.add('active');
            currentFilter = btn.dataset.filter;
            renderSidebar(searchInput.value);
        });
    });
    
    // Theme toggle
    const themeToggle = document.getElementById('themeToggle');
    if (themeToggle) {
        themeToggle.addEventListener('click', toggleTheme);
    }
    
    // Copy format selector
    const copyFormatSelect = document.getElementById('copyFormatSelect');
    if (copyFormatSelect) {
        copyFormatSelect.value = copyFormat;
        copyFormatSelect.addEventListener('change', (e) => {
            copyFormat = e.target.value;
            localStorage.setItem('db-explorer-copy-format', copyFormat);
            // If there are selected values, re-copy them with new format
            if (selectedValues.length > 0) {
                const formattedValues = formatValuesForCopy(selectedValues);
                copyToClipboard(formattedValues);
                showToast('Format changed - ' + selectedValues.length + ' values re-copied');
            }
        });
    }
}

// Utilities
function formatNumber(num) {
    if (num >= 1000000) {
        return (num / 1000000).toFixed(1) + 'M';
    } else if (num >= 1000) {
        return (num / 1000).toFixed(1) + 'K';
    }
    return num.toString();
}

function escapeHtml(text) {
    const div = document.createElement('div');
    div.textContent = text;
    return div.innerHTML;
}

// Value chip click-to-copy functionality
function setupValueChipHandlers() {
    document.querySelectorAll('.value-chip').forEach(chip => {
        chip.addEventListener('click', handleValueChipClick);
    });
}

function handleValueChipClick(e) {
    e.stopPropagation(); // Prevent field header toggle
    
    const chip = e.currentTarget;
    const value = chip.dataset.value;
    
    if (e.shiftKey) {
        // Shift+click: toggle selection for multi-copy
        toggleValueSelection(chip, value);
    } else {
        // Regular click: clear previous selections and copy single value
        clearValueSelections();
        const formattedValue = formatValuesForCopy(value);
        copyToClipboard(formattedValue);
        showCopyFeedback(chip, formattedValue);
    }
}

function toggleValueSelection(chip, value) {
    const index = selectedValues.indexOf(value);
    
    if (index > -1) {
        // Already selected, remove it
        selectedValues.splice(index, 1);
        chip.classList.remove('selected');
    } else {
        // Add to selection
        selectedValues.push(value);
        chip.classList.add('selected');
    }
    
    // Copy all selected values
    if (selectedValues.length > 0) {
        const formattedValues = formatValuesForCopy(selectedValues);
        copyToClipboard(formattedValues);
        showMultiCopyFeedback(selectedValues.length);
    } else {
        hideMultiCopyFeedback();
    }
}

function clearValueSelections() {
    selectedValues = [];
    document.querySelectorAll('.value-chip.selected').forEach(chip => {
        chip.classList.remove('selected');
    });
    hideMultiCopyFeedback();
}

function formatValuesForCopy(values) {
    // values can be a single value (string) or array of values
    const valArray = Array.isArray(values) ? values : [values];
    
    switch (copyFormat) {
        case 'newline':
            return valArray.join('\n');
        case 'sql-text':
            return "('" + valArray.join("', '") + "')";
        case 'comma':
        default:
            return valArray.join(', ');
    }
}

function getCopyFormatLabel() {
    switch (copyFormat) {
        case 'newline': return 'Newline';
        case 'sql-text': return 'SQL Text';
        case 'comma':
        default: return 'Comma';
    }
}

function copyToClipboard(text) {
    navigator.clipboard.writeText(text).catch(err => {
        // Fallback for older browsers
        const textarea = document.createElement('textarea');
        textarea.value = text;
        textarea.style.position = 'fixed';
        textarea.style.opacity = '0';
        document.body.appendChild(textarea);
        textarea.select();
        document.execCommand('copy');
        document.body.removeChild(textarea);
    });
}

function showCopyFeedback(chip, value) {
    // Add copied class for visual feedback
    chip.classList.add('copied');
    
    // Show toast notification
    showToast('Copied: ' + (value.length > 30 ? value.substring(0, 30) + '...' : value));
    
    // Remove copied class after animation
    setTimeout(() => {
        chip.classList.remove('copied');
    }, 600);
}

function showMultiCopyFeedback(count) {
    showToast(count + ' values copied (Shift+click to add more)');
}

function hideMultiCopyFeedback() {
    // Could hide a persistent indicator if we had one
}

function showToast(message) {
    // Remove existing toast if any
    const existingToast = document.querySelector('.copy-toast');
    if (existingToast) {
        existingToast.remove();
    }
    
    // Create toast element
    const toast = document.createElement('div');
    toast.className = 'copy-toast';
    toast.innerHTML = `
        <svg width="16" height="16" viewBox="0 0 24 24" fill="none" stroke="currentColor" stroke-width="2">
            <polyline points="20 6 9 17 4 12"/>
        </svg>
        <span>${escapeHtml(message)}</span>
    `;
    
    document.body.appendChild(toast);
    
    // Trigger animation
    requestAnimationFrame(() => {
        toast.classList.add('visible');
    });
    
    // Remove after delay
    setTimeout(() => {
        toast.classList.remove('visible');
        setTimeout(() => toast.remove(), 300);
    }, 2000);
}

// Clear selections when clicking elsewhere
document.addEventListener('click', (e) => {
    if (!e.target.closest('.value-chip') && !e.shiftKey) {
        clearValueSelections();
    }
});
